export class WithdrawWithERC7702CallGasPaymentStruct extends ethereum.Tuple {
  get user(): Address {
    return this[0].toAddress();
  }

  get token(): Address {
    return this[1].toAddress();
  }

  get amount(): BigInt {
    return this[2].toBigInt();
  }

  get deadline(): BigInt {
    return this[3].toBigInt();
  }

  get signature(): Bytes {
    return this[4].toBytes();
  }
}
